import { ADD_TO_CART } from "../actions/cart";

const initialState = {
    items: 0
};

cartReducer = createReducer(initialState, {
    [ADD_TO_CART]: (state, action) => {
        return {
            ...state,
            items: items + 1
        };
    }
})

export default cartReducer;
